        <p>{title}</p>
        <p className="product-price">
          <small>$</small>
          <strong>{price}</strong>
        </p>
        <div className="product-rating">
          {Array(rating)
            .fill()
            .map((_, i) => (
              <p>‚≠ê</p>
            ))}
        </div>
      </div>
      <img className="product-image" alt="" src={img}></img>
      <button>Add to Basket</button>
    </div>
  );
}

export default Product;
